import React from 'react';
import './App.css';
import {useTransition} from './lib/useTransition.js'
function App() {
  const color = useTransition("#dd66ff", "#ffcc99", 0.5);
  const number = useTransition(0,100,0.5);
  return (
    <div className="App">
      <div style = {{fontSize: (number)}}>{Math.round(number)}</div>
    </div>
  );
}

export default App;
